import imgLargeClasses from "./ImageLarge.module.css";
import ImageLarger from "./ImagesForLarge";

function ImageLarge({
  id,
  url,
  description,
  name,
  height,
  width,
}) {
  return (
    <ImageLarger
      {...{
        id,
        url,
        description,
        name,
        height,
        width,
        className: imgLargeClasses.img,
      }}
    />
  );
}



export default ImageLarge;
